import {BrowserRouter, Navigate, Route, Routes, Router, useLocation, useNavigate} from "react-router-dom";
import './App.css';
import Login from "./pages/Login"
import Home from "./pages/Home"
import Queue from "./pages/Queue"
import Create from "./pages/Create"

export const ROUTES = {
    LOGIN: "/login",
    HOME: "/home",
    QINFO: "/queue",
    CREATE: "/qcreate"
}


function App() {

  return (
    <div className="App">
      <BrowserRouter>
        <div>
          <Routes>
            <Route exec path="/login" element={<Login />} />
            <Route path="/home" element={<Home />} />
            <Route path="/queue" element={<Queue />} />
            <Route path="/qcreate" element={<Create />} />
          </Routes>
        </div>
      </BrowserRouter>
      <div className='object'>Hello World</div>
    </div>
  );
}

export default App;
